-- ----------------------------
-- Table structure for `hc_communities`
-- ----------------------------
DROP TABLE IF EXISTS `hc_communities`;
CREATE TABLE `hc_communities` (
  `community_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '小区id',
  `name` varchar(255) NOT NULL COMMENT '小区名',
  `company_id` int(11) unsigned NOT NULL COMMENT '公司id',
  `state` tinyint(1) NOT NULL COMMENT '状态(-1：已删除；1：正常)',
  `user_id` bigint(20) NOT NULL COMMENT '用户id，小区管理员',
  `theme_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '模板id',
  `role_inherit` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否继承公司权限(1--是，0--否)',
  `province_id` int(11) NOT NULL DEFAULT '0' COMMENT '省份id',
  `city_id` int(11) NOT NULL DEFAULT '0' COMMENT '城市id',
  `area_id` int(11) NOT NULL DEFAULT '0' COMMENT '行政区id',
  `street` text NOT NULL COMMENT '详细街道',
  `longitude` decimal(10,6) NOT NULL DEFAULT '0.000000' COMMENT '经度',
  `latitude` decimal(10,6) NOT NULL DEFAULT '0.000000' COMMENT '纬度',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户id',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `update_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户id',
  PRIMARY KEY (`community_id`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 COMMENT='小区表';

-- ----------------------------
-- Records of hc_communities
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_companys`
-- ----------------------------
DROP TABLE IF EXISTS `hc_companys`;
CREATE TABLE `hc_companys` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '公司id',
  `company_name` varchar(50) NOT NULL COMMENT '公司名',
  `user_id` bigint(20) NOT NULL COMMENT '用户id，公司拥有者',
  `company_status` int(11) NOT NULL DEFAULT '1' COMMENT '公司状态 0：禁用； 1：正常 ；2：未验证',
  `logo` varchar(255) NOT NULL COMMENT '公司logo，相对于upload/logo目录',
  `remark` text NOT NULL COMMENT '备注',
  `token` varchar(255) NOT NULL COMMENT '微信接口token，系统自动生成32位随机码',
  `theme_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '模板id',
  `auth_access` text NOT NULL COMMENT '权限授权(php数组序列化)',
  `invitation` varchar(255) NOT NULL DEFAULT '' COMMENT '公司邀请码',
  `invitation_create_time` int(11) NOT NULL DEFAULT '0' COMMENT '邀请码创建时间',
  `create_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8 COMMENT='公司表';

-- ----------------------------
-- Records of hc_companys
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_lifestyles`
-- ----------------------------
DROP TABLE IF EXISTS `hc_lifestyles`;
CREATE TABLE `hc_lifestyles` (
  `lifestyle_id` int(7) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '爱家id',
  `zhanghu` varchar(255) NOT NULL COMMENT '账户',
  `number` varchar(255) NOT NULL COMMENT '客户编码',
  `name` text NOT NULL COMMENT '客户名称',
  `state` tinyint(1) NOT NULL COMMENT '状态(-1--删除，1--正常)',
  `money` varchar(255) NOT NULL COMMENT '收费金额',
  `create_time` bigint(20) unsigned NOT NULL COMMENT '票据创建时间',
  `create_user_id` bigint(20) unsigned NOT NULL COMMENT '创建用户id，开票人',
  `time` date NOT NULL COMMENT '票据日期',
  `update_user_id` bigint(20) NOT NULL COMMENT '最后更新用户id',
  `content` varchar(255) NOT NULL DEFAULT 'xxxx年xx月技术服务费' COMMENT '收费项目',
  `zhanghu_name` varchar(255) NOT NULL DEFAULT '' COMMENT '户名',
  PRIMARY KEY (`lifestyle_id`)
) ENGINE=InnoDB AUTO_INCREMENT=72 DEFAULT CHARSET=utf8 COMMENT='爱家文章列表';

-- ----------------------------
-- Records of hc_lifestyles
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_menu`
-- ----------------------------
DROP TABLE IF EXISTS `hc_menu`;
CREATE TABLE `hc_menu` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `parentid` smallint(6) unsigned NOT NULL DEFAULT '0',
  `app` varchar(30) NOT NULL DEFAULT '' COMMENT '应用名称app',
  `model` varchar(30) NOT NULL DEFAULT '' COMMENT '控制器',
  `action` varchar(50) NOT NULL DEFAULT '' COMMENT '操作名称',
  `data` varchar(50) NOT NULL DEFAULT '' COMMENT '额外参数',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '菜单类型  1：权限认证+菜单；0：只作为菜单',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态，1显示，0不显示',
  `name` varchar(50) NOT NULL COMMENT '菜单名称',
  `icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `listorder` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '排序ID',
  `module_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属模块id',
  PRIMARY KEY (`id`),
  KEY `status` (`status`),
  KEY `parentid` (`parentid`),
  KEY `model` (`model`)
) ENGINE=InnoDB AUTO_INCREMENT=707 DEFAULT CHARSET=utf8 COMMENT='后台菜单表';

-- ----------------------------
-- Records of hc_menu
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_options`
-- ----------------------------
DROP TABLE IF EXISTS `hc_options`;
CREATE TABLE `hc_options` (
  `option_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `option_name` varchar(64) NOT NULL COMMENT '配置名',
  `option_value` longtext NOT NULL COMMENT '配置值',
  `autoload` int(2) NOT NULL DEFAULT '1' COMMENT '是否自动加载',
  PRIMARY KEY (`option_id`),
  UNIQUE KEY `option_name` (`option_name`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='全站配置表';

-- ----------------------------
-- Records of hc_options
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_role`
-- ----------------------------
DROP TABLE IF EXISTS `hc_role`;
CREATE TABLE `hc_role` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL COMMENT '角色名称',
  `pid` smallint(6) DEFAULT NULL COMMENT '父角色ID',
  `status` tinyint(1) unsigned DEFAULT NULL COMMENT '状态',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `listorder` int(3) NOT NULL DEFAULT '0' COMMENT '排序字段',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '2' COMMENT '角色类型 0：运营者角色；1：系统角色；2：用户自定义角色；3：超级管理员；4：公司超级管理员；5：小区超级管理员',
  `company_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '公司ID',
  `community_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '小区id',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户id',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `update_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户id',
  PRIMARY KEY (`id`),
  KEY `parentId` (`pid`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=354 DEFAULT CHARSET=utf8 COMMENT='角色表';

-- ----------------------------
-- Records of hc_role
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_role_user`
-- ----------------------------
DROP TABLE IF EXISTS `hc_role_user`;
CREATE TABLE `hc_role_user` (
  `role_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '角色 id',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '用户id',
  `company_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '公司id',
  `community_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '小区id',
  KEY `group_id` (`role_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户角色对应表';

-- ----------------------------
-- Records of hc_role_user
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_users`
-- ----------------------------
DROP TABLE IF EXISTS `hc_users`;
CREATE TABLE `hc_users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_login` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `user_pass` varchar(64) NOT NULL DEFAULT '' COMMENT '登录密码；sp_password加密',
  `user_name` varchar(50) NOT NULL DEFAULT '' COMMENT '用户真实姓名',
  `user_nicename` varchar(50) NOT NULL DEFAULT '' COMMENT '用户美名',
  `user_email` varchar(100) NOT NULL DEFAULT '' COMMENT '登录邮箱',
  `user_url` varchar(100) NOT NULL DEFAULT '' COMMENT '用户个人网站',
  `avatar` varchar(255) DEFAULT NULL COMMENT '用户头像，相对于upload/avatar目录',
  `sex` smallint(1) DEFAULT '0' COMMENT '性别；0：保密，1：男；2：女',
  `birthday` date DEFAULT '2000-01-01' COMMENT '生日',
  `signature` varchar(255) DEFAULT NULL COMMENT '个性签名',
  `last_login_ip` varchar(16) DEFAULT NULL COMMENT '最后登录ip',
  `last_login_time` datetime NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '最后登录时间',
  `user_activation_key` varchar(60) NOT NULL DEFAULT '' COMMENT '激活码',
  `user_status` int(11) NOT NULL DEFAULT '1' COMMENT '用户状态 0：禁用； 1：正常 ；2：未验证',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '用户积分',
  `user_type` smallint(1) DEFAULT '1' COMMENT '用户类型，1:admin ;2:会员',
  `coin` int(11) NOT NULL DEFAULT '0' COMMENT '金币',
  `credits` int(11) NOT NULL COMMENT '积分',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  `area` tinyint(1) NOT NULL DEFAULT '1' COMMENT '用户地区(1--大陆，2--香港，3--澳门)',
  `setting` text NOT NULL COMMENT '用户设置(json格式)',
  `last_login_company` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '管理员最后登录公司id',
  `last_login_community` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '管理员最后登录小区id',
  `mobile_last_login_community` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'app最后登录小区id',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `create_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户id',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `update_user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户id',
  PRIMARY KEY (`id`),
  KEY `user_login_key` (`user_login`),
  KEY `user_nicename` (`user_nicename`)
) ENGINE=InnoDB AUTO_INCREMENT=231 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of hc_users
-- ----------------------------

-- ----------------------------
-- Table structure for `hc_user_login_hist`
-- ----------------------------
DROP TABLE IF EXISTS `hc_user_login_hist`;
CREATE TABLE `hc_user_login_hist` (
  `history_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '历史id',
  `user_id` bigint(20) unsigned NOT NULL COMMENT '用户id',
  `source` tinyint(1) NOT NULL COMMENT '来源(1--微信，2--app，3--物业管理后台，4--企业号，5--运营平台)',
  `order_id` bigint(20) unsigned NOT NULL COMMENT '来源对应记录id',
  `login_time` datetime NOT NULL COMMENT '登录时间',
  `login_ip` varchar(16) NOT NULL COMMENT '登录ip',
  `country` varchar(255) NOT NULL COMMENT '国家',
  `province` varchar(255) NOT NULL COMMENT '省份',
  `city` varchar(255) NOT NULL COMMENT '城市',
  `district` varchar(255) NOT NULL COMMENT '地区',
  `isp` varchar(255) NOT NULL COMMENT '运营商',
  `os` varchar(255) NOT NULL COMMENT '用户系统',
  `browser` varchar(255) NOT NULL COMMENT '用户浏览器',
  `lang` varchar(255) NOT NULL COMMENT '用户系统语言',
  `mapping_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '微信关联id',
  `info_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '手机信息id',
  PRIMARY KEY (`history_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12076 DEFAULT CHARSET=utf8 COMMENT='用户登录记录';

